import React from "react";
import "./styles.css";

const Menu = () => {
  const menuItems = [
    { id: 1, name: "Grilled Chicken", price: "$12.99", image: "https://via.placeholder.com/100" },
    { id: 2, name: "Veggie Pizza", price: "$9.99", image: "https://via.placeholder.com/100" },
  ];

  return (
    <main className="menu">
      <h2>Our Menu</h2>
      <div className="menu-items">
        {menuItems.map((item) => (
          <div key={item.id} className="menu-item">
            <img src={item.image} alt={item.name} />
            <h3>{item.name}</h3>
            <p>{item.price}</p>
            <button>Add to Cart</button>
          </div>
        ))}
      </div>
    </main>
  );
};

export default Menu;
